import React, { Component } from 'react';
import people from '../images/people.png';
import icon from '../images/icon.png';

class CarouselSlide extends Component {
  render() {
    return (
      <li
        className={
          this.props.index == this.props.activeIndx
            ? "carousel-slide carousel-slide-active"
            : "carousel-slide"
        }
      >
        <div className="carousel-slide-content">
          <img src={this.props.slide.image_url} />
        </div>

        <div className="carousel__slide__source_container">
          <div className="carousel-top-container">
            <img src={people} className="img_people_container"/>
            <span className="carousel_slide_title">
              {this.props.slide.title}
            </span>
            <div className="carousel_slide_subtitle">
              {this.props.slide.subtitle}
            </div>
          </div>
          <div className="carousel_slide_content">
            {this.props.slide.text}
          </div>
          <div className="carousel__slide__icon">
            <img src={icon} className="icon-image"/>
          </div>
        </div>
      </li>
    );
  }
}
export default CarouselSlide;
